vector: true

script: |
  super -f text -I q189.spq > q189.out

inputs:
  - name: q189.spq
    data: |
      SELECT d,
      a+b*2+c*3
      FROM t1 (FORMAT parquet)
      WHERE e+d BETWEEN a+b-10 AND c+130
      ORDER BY 2,1;
  - name: t1

outputs:
  - name: q189.out
    data: |
      101	610
      108	635
      114	674
      116	708
      122	738
      128	760
